#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <math.h>

// Define the memory location of the buttons
#define BUTTONS_MEM_LOC 0xff200050

#define WHITE 0xFFFF
#define BLACK 0x0000
#define PINK 0xF81F
#define BLUE 0x001F
#define RED 0xF800
#define GREEN 0x07E0

#define WIDTH 320
#define HEIGHT 240

#define min(a, b) ((a) < (b) ? (a) : (b))
#define max(a, b) ((a) > (b) ? (a) : (b))

void load_screen();
void clear_screen(bool clear_text_box);
void wait_for_vsync();
void loadCanvas(const char *filename);
void setColor(int x_start, int y_start, int x_end, int y_end, short int color);
void draw_coloredCanvas();
bool isSetupFinished(); // Function to check if the last button is pressed
void plot_pixel(int x, int y, short int line_color);
void draw_maze(short int background_color, short int wall_color);
void init_sphere_canvas();
void draw_filled_circle_in_array(int center_x, int center_y, int radius);
void combine_and_draw(short int background_color, short int wall_color, short int circle_color);
void move_sphere();

volatile int *pixel_ctrl_ptr;
volatile int pixel_buffer_start;

int canvas[HEIGHT][WIDTH];
int setupCanvas[HEIGHT][WIDTH];         // Your binary canvas
short int coloredCanvas[HEIGHT][WIDTH]; // Canvas to hold color values
short int sphereCanvas[HEIGHT][WIDTH];

int sphereX = 290; // Initial X position of the sphere
int sphereY = 205; // Initial Y position of the sphere
int radius = 10;   // Radius of the sphere
int velocityX = 4; // X velocity
int velocityY = 2; // Y velocity

short int BACKGROUND_COLOR;
short int WALL_COLOR;
short int SPHERE_COLOR;

int main(void)
{

    /*************************Initializing front/back pixel buffer ****************************/

    pixel_ctrl_ptr = (int *)0xFF203020; // pointing at the front buffer
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer
    wait_for_vsync();
    // Initialize the base address to the first pixel in the front buffer(On-chip)
    pixel_buffer_start = *pixel_ctrl_ptr;

    // Initializing 320x240 pixels in the front buffer
    load_screen(); // pixel_buffer_start points to the pixel buffer

    *(pixel_ctrl_ptr + 1) = 0xC0000000;         // set back pixel buffer to start of SDRAM memory
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    // Initializing 320x240 pixels in the back buffer(SDRAM)
    load_screen();
    wait_for_vsync();

    // Setup part, change this part
    // Set colors for specific regions (example regions given)
    setColor(60, 100, 100, 140, BLUE);   // Wall
    setColor(140, 100, 180, 140, RED);   // Wall
    setColor(220, 100, 260, 140, GREEN); // Sphere
    draw_coloredCanvas();
    while (true)
    {
        if (isSetupFinished())
        {
            break; // Exit the loop if the last button is pressed
        }
    }

    // Setup is finished, start the game :)
    draw_maze(PINK, BLACK);

    draw_filled_circle_in_array(sphereX, sphereY, radius);

    combine_and_draw(WHITE, BLACK, BLUE);

    while (1)
    {
        move_sphere();
        combine_and_draw(GREEN, RED, BLUE);
    }

    return 0;
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_maze(short int background_color, short int wall_color)
{
    for (int y = 0; y < 240; y++)
    {
        for (int x = 0; x < 320; x++)
        {
            short int color;
            if (canvas[y][x] == 0)
            { // background
                color = background_color;
            }
            else
            { // wall
                color = wall_color;
            }
            plot_pixel(x, y, color);
        }
    }
}

// Initialize sphere_canvas array to zero
void init_sphere_canvas()
{
    for (int y = 0; y < HEIGHT; y++)
    {
        for (int x = 0; x < WIDTH; x++)
        {
            sphereCanvas[y][x] = 0;
        }
    }
}

// Fill the sphereCanvas with the filled circle
void draw_filled_circle_in_array(int center_x, int center_y, int radius)
{
    init_sphere_canvas();
    for (int y = -radius; y <= radius; y++)
    {
        for (int x = -radius; x <= radius; x++)
        {
            if (x * x + y * y <= radius * radius)
            {
                int canvasX = center_x + x;
                int canvasY = center_y + y;
                if (canvasX >= 0 && canvasX < WIDTH && canvasY >= 0 && canvasY < HEIGHT)
                {
                    sphereCanvas[canvasY][canvasX] = 1; // Assuming 1 represents sphere
                }
            }
        }
    }
}

void combine_and_draw(short int background_color, short int wall_color, short int circle_color)
{
    for (int y = 0; y < HEIGHT; y++)
    {
        for (int x = 0; x < WIDTH; x++)
        {
            short int color;
            if (sphereCanvas[y][x] == 1)
            {
                // If the pixel is part of the circle
                color = circle_color;
            }
            else if (canvas[y][x] == 1)
            {
                // If the pixel is part of the wall
                color = wall_color;
            }
            else
            {
                // Background
                color = background_color;
            }
            plot_pixel(x, y, color);
        }
    }
}

void move_sphere()
{
    // Predict the next position
    int nextX = sphereX + velocityX;
    int nextY = sphereY + velocityY;

    // Check for horizontal collision
    for (int y = -radius; y <= radius; y++)
    {
        if (nextY + y >= 0 && nextY + y < HEIGHT)
        {
            if ((nextX - radius >= 0 && canvas[nextY][nextX - radius] == 1 && velocityX < 0) ||
                (nextX + radius < WIDTH && canvas[nextY][nextX + radius] == 1 && velocityX > 0))
            {
                velocityX = -velocityX;
                break; // Break after detecting any collision
            }
        }
    }

    // Check for vertical collision
    for (int x = -radius; x <= radius; x++)
    {
        if (nextX + x >= 0 && nextX + x < WIDTH)
        {
            if ((nextY - radius >= 0 && canvas[nextY - radius][nextX] == 1 && velocityY < 0) ||
                (nextY + radius < HEIGHT && canvas[nextY + radius][nextX] == 1 && velocityY > 0))
            {
                velocityY = -velocityY;
                break; // Break after detecting any collision
            }
        }
    }

    // Update sphere position based on updated velocity
    sphereX += velocityX;
    sphereY += velocityY;

    // Keep the sphere within bounds
    sphereX = max(0, min(sphereX, WIDTH - 1));
    sphereY = max(0, min(sphereY, HEIGHT - 1));

    // printf("vel x : %d\n", velocityX);
    // printf("vel y : %d\n", velocityY);
    // Draw sphere again
    draw_filled_circle_in_array(sphereX, sphereY, radius);
}




void load_screen()
{
    // Redraw whole 320x240 VGA screen to WHITE
    for (int x = 0; x < 320; x++)
    {
        for (int y = 0; y < 240; y++)
        {
            plot_pixel(x, y, WHITE); // Plotting black pixel all over the VGA display
        }
    }
}

void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020; // pixel controller of front buffer address
    register int status;                              // the status register

    *pixel_ctrl_ptr = 1; // start the synchronization procress by writing
                         //  the value 1 into the front Buffer register in the pixel buffer controller

    status = *(pixel_ctrl_ptr + 3); // Wait for the S bit to become 0, that means VGA sweep is done
    // 3*(4 bits) = 12 bits = 0xFF20302C

    // Polling to get status bit
    while ((status & 0x01) != 0)
    { // wait until bit S of the Status register becomes equal to 0
        status = *(pixel_ctrl_ptr + 3);
    }
}

void clear_screen(bool clear_text_box)
{
    if (!clear_text_box)
    { // clear the whole screen
        for (int x = 0; x < 320; x++)
        {
            for (int y = 0; y < 240; y++)
            {
                plot_pixel(x, y, WHITE); // Plotting black pixel all over the VGA display
            }
        }
    }
    else
    {
        for (int x = 31; x < 300; x++)
        {
            for (int y = 41; y < 230; y++)
            {
                plot_pixel(x, y, WHITE); // Plotting black pixel all over the VGA display
            }
        }
    }
}

// Function to set color for a specific region
void setColor(int x_start, int y_start, int x_end, int y_end, short int color)
{
    for (int y = y_start; y <= y_end; y++)
    {
        for (int x = x_start; x <= x_end; x++)
        {
            if (setupCanvas[y][x] == 1)
            { // Check if the pixel is part of the item
                coloredCanvas[y][x] = color;
            }
        }
    }
}

// Draw the colored canvas
void draw_coloredCanvas()
{
    for (int y = 0; y < 240; y++)
    {
        for (int x = 0; x < 320; x++)
        {
            short int color;
            if (coloredCanvas[y][x] == 0)
            { // background
                color = WHITE;
            }
            else
            { // wall
                color = coloredCanvas[y][x];
            }
            plot_pixel(x, y, color);
        }
    }
}

// Function to check if the last button is pressed
bool isSetupFinished()
{
    // Create a pointer to the button memory location
    volatile uint32_t *buttons = (volatile uint32_t *)BUTTONS_MEM_LOC;

    // Read the state of the buttons
    uint32_t state = *buttons;

    // Adjust here
    return (state & 0x01) != 0;
}

// Initialize canvas from a csv file
void loadCanvas(const char *filename)
{
    FILE *file = fopen(filename, "r");
    if (file == NULL)
    {
        perror("Error opening file");
        return;
    }

    for (int i = 0; i < 240; i++)
    {
        for (int j = 0; j < 320; j++)
        {
            if (fscanf(file, "%d,", &canvas[i][j]) != 1)
            {
                perror("Error reading file");
                fclose(file);
                return;
            }
        }
    }

    fclose(file);
}

